import * as types from "./../Constant/ActionTypes";

let initialState = [];

const works = (state = initialState, action) => {
  switch (action.type) {
    case types.GET_WORK:
      state = [...action.works];
      return [...state];
    case types.ADD_WORK:
      return [...state];
    default:
      return [...state];
  }
};

export default works;
